urbine for mining gravel/stone, per DTE\'s email. He said he would take agreement, mining recommendations to his atty. As long as he didn\'t see an issue, he\'s willing to participate in project. Most likely with all non-Beaver Twp land first. Will bring on Beaver Twp land later if Beaver Twp Board adopts a wind friendly ordinance. He does a lot of work for Beaver Twp and is afraid of losing work if he signs up before this time.  He will be gone the week of the 19th. He said I can check in with him the last week of Feb, first week of March. \n02/07/2018: LS - Dropped off PA116 Letter.\n02/06/2018: LS - Met with LO. Discussed project and easement. Seems mildly interested, but nervous of Beaver Twp. He does a lot of work for the Twp. so he\'s afraid if he commits to project, Beaver Twp. officials will not give him work. Suggested signing non Beaver Twp land until the dust settles, then signing Beaver Twp land at a later date. \n12/06/2017: LS - Reached out to Randy, asked if we could meet. He\'s too busy today but I can stop by again after the first of the year. 10/20/2017: RB - Stopped at office but Randy said he was too busy. I asked if hes interested and he said he was. I told him to please find time next week if it rains.\n08/16/2017: RB - Stopped by office and Randy apologized for not calling. Will meet next week.06/20/2017: RB - Stopped by office but Randy was busy.06/16/2017: RB - Met briefly with Randy. Randy has excavating business and has contracted for windfarms before. We will try next week when he has more time. \n06/12/2017: RB - Stopped by residence but it was a renter. Randy has business that I stopped at in Auburn. \"','GUSHOW RANDALL T & T & M REAL','1676 W MIDLAND RD','AUBURN','MI','48611','989-662-6591','989-662-6591-Randy Cell','2018-07-12 02:56:01','0000-00-00 00:00:00'),(206,'GUSHOW, M',NULL,1,74,'Summers, L',NULL,'Owner Declined','Wildlife','2018-01-03','\"01/03/2018: LS - Met with ME. She\'s declined. She is of the belief that turbines are harmful to wildlife. She even says \'I know this sounds ridiculous, but I love my animals.\'  Have also reached out to Randy Gushow, her brother in law. (Her husband is deceased.) She owns land with Randy. She did say that whatever Randy wants to do with their combined land, she will do whateve he wants.  Will reach out Randy. Hopeful that if we can get Randy to participate, Mary Ellen will change her mind. 12/06/2017: LS - Reached out to Mary Ellen, asked if we could meet. She\'s too busy today but I can stop by again after the first of the year.11/03/2017: LS - Met with LO. She\'s leaning more towards participating but wants to discuss more with family. I can follow up in a couple weeks. \n10/09/2017: LS - Met with LO again. She\'s on the fence. She believes in renewables, but is nervous about actually having wind turbine on her land. She\'s going to discuss with some family members and I can follow up in a month or so. 10/06/2017: LS - Phone call to LO. Made appt for Monday to meet. \n08/28/2017: LS - Called and asked for FU appt. LO asked I call next week, when kids are back in school. (Grandma babysits kids for summer.)08/08/2017: LS - Met with LO. Discussed easement and project. Will follow up end of the month. \n08/04/2017: JB - Summers intro letter sent.\"','GUSHOW, MARY ELLYN','1678 W WILDER RD','AUBURN','MI','48611','989-662-6745-Mary El','989-239-9484-Home','2018-07-12 02:56:01','0000-00-00 00:00:00'),(207,'GUSHOW, R',NULL,1,65,'Summers, L',NULL,'Negotiating with Owner',NULL,'2018-02-16','\"02/16/2018: LS - Met with Randy. Explained setbacks from turbine for mining gravel/stone, per DTE\'s email. He said he would take agreement, mining recommendations to his atty. As long as he didn\'t see an issue, he\'s willing to participate in project. Most likely with all non-Beaver Twp land first. Will bring on Beaver Twp land later if Beaver Twp Board adopts a wind friendly ordinance. He does a lot of work for Beaver Twp and is afraid of losing work if he signs up before this time.  He will be gone the week of the 19th. He said I can check in with him the last week of Feb, first week of March. \n02/07/2018: LS - Dropped off PA116 Letter.\n02/06/2018: LS - Met with LO. Discussed project and easement. Seems mildly interested, but nervous of Beaver Twp. He does a lot of work for the Twp. so he\'s afraid if he commits to project, Beaver Twp. officials will not give him work. Suggested signing non Beaver Twp land until the dust settles, then signing Beaver Twp land at a later date. \n12/06/2017: LS - Reached out to Randy, asked if we could meet. He\'s too busy today but I can stop by again after the first of the year.10/20/2017: RB - Stopped at office but Randy said he was too busy. I asked if hes interested and he said he was. I told him to please find time next week if it rains.\n08/16/2017: RB - Stopped by office and Randy apologized for not calling. Will meet next week.06/20/2017: RB - Stopped by office but Randy was busy.06/16/2017: RB - Met briefly with Randy. Randy has excavating business and has contracted for windfarms before. We will try next week when he has more time. \n06/12/2017: RB - Stopped by residence but it was a renter. Randy has business that I stopped at in Auburn. \"','GUSHOW, RANDALL T','W ANDERSON RD','LINWOOD','MI','48634','989-662-6591','989-662-6591-Randy Cell','2018-07-12 02:56:01','0000-00-00 00:00:00'),(208,'GUSTY FARMS',NULL,2,120,'Benson, R','Summers, L','Owner Declined','Title Encumbrance','2017-08-04','\"08/04/2017: RB - Spoke to Don and he is not interested because of the longevity of the agreement and DTE has too much control of his land for too long.07/26/2017: RB - Spoke to Don Schultz who lives near Kalamazoo. Mailed Don the agreement. \n07/12/2017: JB - Intro letter sent.\"','GUSTY FARMS INC','5275 S 36Th St','Climax','MI','49034','269-665-4964',NULL,'2018-07-12 02:56:01','0000-00-00 00:00:00'),(209,'GWIZDALA, W',NULL,1,40,NULL,NULL,'Targeted',NULL,'2017-03-02','','GWIZDALA, WANDA S','4163 Car